function createObjectFromArray(dateBase) {
	let arr = dateBase.map(item => {
		return item.split('$');
	});

	let arr2 = [];
	arr.forEach((item,index) => {
		arr2[index] = [];
		item.forEach( item => {
		arr2[index].push(item.split('@'))
		});
	});


	let arr3 = arr2.map(item => {
	return Object.fromEntries(item);
	});


	let obj= {};

	arr3.forEach(item => {
	obj[item['Кадастровый номер']] = item;
	});

	return obj;
}


